import React,{useState} from 'react'

 const stateExample = () => {
    const[count,setCount] = useState(0);
    const handup =()=>{
        setCount(count + 1)
    }
    const handdown =()=>{
        setCount(count - 1)
    }
  return (
    <div>
        <label>count is {count}</label>
        <button onClick={handup}>+</button>
        <button onClick={handdown}>-</button>
    </div>
  )
}
export default stateExample;
